문서: 최근 복부 수술을 받은 남편이 아직 회복 중인 상황에서 여왕은 오늘 스코틀랜드에 도착하여 충실한 반려견들과 함께 휴가를 보내야 했습니다. 분홍색 비옷과 익숙한 꽃무늬 머리스카프를 착용한 여왕은 개인 제트기로 런던에서 아버딘으로 올라가 바루몰 성에서 2개월간의 하이랜드 휴식을 시작합니다. 그러나 올해는 그녀의 92세 남편이 최근 복부 수술로 인해 몇 주간 혼자 지내야 합니다. 여왕은 이날 오후 분홍색 의상을 입고 아버딘 공항에 도착하였습니다.
@highlight
92세 프린스 필립 왕자는 복부 수술 후 회복 중입니다.
@highlight
여왕은 사랑하는 코기들 윌로우와 할리와 함께 있습니다.
@highlight
그녀는 바루몰 성에서 여름 2개월간 지낼 것입니다.
궁궐 웹사이트는 그녀의 애완동물에 대해 다음과 같이 말합니다. ‘@placeholder 여왕의 코기들은 여러 거주지로 함께 이동하며, 바쁜 일정 때문에 가능한 한 스스로 돌보고 있습니다.’

